import React, { useState } from "react";

function Form() {
  const [newTodo, setNewTodo] = useState({});

  const handleChange = e => {
    setNewTodo({ [e.target.name]: e.target.value });
  };

  return (
    <form>
      <input
        name="newTodo"
        type="text"
        value={newTodo}
        onChange={handleChange}
      />
    </form>
  );
}

export default Form;
